import React from "react";
import Note from "./Note";
import notes from "../notes";

function Card(){
    return(
        <div>
        {notes.map(notesItem => {return(
        <Note
        key = {notesItem.key}
        title = {notesItem.title}
        content = {notesItem.content}
    /> )})
    }
        </div>
    )
}
export default Card;
